  //
  // Freewall script settings
  //
  var gutter = 10;
  
  $(function() {
    var wall = new Freewall(".freewall .view-content");
    var productsWall = new Freewall(".products-freewall .view-content");
    var productsHome = new Freewall(".products-home-freewall .view-content");
    wallRedraw(wall);
    wallRedrawProducts(productsWall);
    wallRedrawHomeProducts(productsHome);
  });
  
  function wallRedraw(wallToRedraw) {
    wallToRedraw.reset({
      selector: '.showcase-item',
      cellW: cellSize,
      cellH: 'auto',
      delay: 30,
      gutterX: gutter,
      gutterY: gutter,
      onResize: function() {
        // Get Windows Width to use similar to media query
        var windowWidth = $(window).width();
        // Reset inline css values after resizing
        wallReset();
        // Redraw
        wallToRedraw.fitZone($(".freewall").width(), $(".freewall").height());
      },
      onBlockActive: function(block, setting) {
        // check for showing brick to lazyload it's image;
        if (block != null) {
          $(this).lazyload();
        }
      },
    });
  
    // Init
    wallToRedraw.fitZone($(".freewall").width(), $(".freewall").height());
  };
  
  function wallRedrawProducts(wallRedrawProduct) {
    wallRedrawProduct.reset({
      selector: '.product',
      cellW: cellSizeProducts,
      cellH: 260,
      gutterX: gutter * 2,
      gutterY: gutter * 2,
      onResize: function () {
        wallRedrawProduct.refresh();
      },
      onBlockActive: function(block, setting) {
        // check for showing brick to lazyload it's image;
        if (block != null) {
          $(this).find('img').lazyload();
        }
      },
    });
  
    // Init
    wallRedrawProduct.fitWidth();
    $(window).trigger("resize");
  };
  
  function wallRedrawHomeProducts(wallRedrawHomeProduct) {
    var windowWidth = $(window).width();
    if (windowWidth > 639) {
    wallRedrawHomeProduct.reset({
        selector: '.product',
        cellW: 210,
        cellH: 260,
  
        gutterX: gutter * 2,
        gutterY: gutter * 2,
        onResize: function() {
          // Get Windows Width to use similar to media query
          var windowWidth = $(window).width();
          // Reset inline css values after resizing
          wallHomeReset();
          // Redraw
          wallRedrawHomeProduct.fitZone($(".products-home-freewall").width(), $(".products-home-freewall").height());
          // document.title = windowWidth;
        },
        onBlockActive: function(block, setting) {
          // check for showing brick to lazyload it's image;
          if (block != null) {
            $(this).find('img').lazyload();
          }
        },
      });
  
      // Init
      wallRedrawHomeProduct.fitZone($(".products-home-freewall").width(), $(".products-home-freewall").height());
  
      // Categories Menu
      $(".categories-label").click(function() {
        var dna = $(".product-categories");
        if ($(".product-categories").hasClass("categories-opened")) {
          wallRedrawHomeProduct.fixSize({
            block: dna,
            width: 210,
            height: 780
          });
        } else {
          wallRedrawHomeProduct.fixSize({
            block: dna,
            width: 210,
            height: 260
          });
        }
        wallRedrawHomeProduct.fitZone($(".products-home-freewall").width(), $(".products-home-freewall").height());
        $(window).scroll();
      });
    } else {
      $('.product').find('img').lazyload();
    }
  };
  
  // Calculate dynamic column sizes
  function cellSize(windowWidth) {
    if (windowWidth > 1600) {
      var colNum = 8;
    } else if (windowWidth > 1200) {
      var colNum = 6;
    } else if (windowWidth > 940) {
      var colNum = 6;
    } else if (windowWidth > 720) {
      var colNum = 5;
    } else if (windowWidth > 560) {
      var colNum = 3;
    } else {
      var colNum = 2;
    }
  
    return (windowWidth / colNum) - gutter;
  }
  
  // Calculate dynamic column sizes
  function cellSizeProducts(windowWidth) {
    if (windowWidth > 560) {
      return 200;
    } else {
      var colNum = 2;
    }
  
    return (windowWidth / colNum) - gutter;
  }
  
  // Function to reset inline css values after resizing
  function wallReset() {
    $(".freewall .brick").css('width', 'auto').css('height', 'auto');
  }
  
  // Function to reset inline css values after resizing
  function wallHomeReset() {
    $(".products-home-freewall .product").css('width', 'auto').css('height', 'auto');
  }
  
  
